const Template = (props) => {


  return (
    <div>
      {props.data.map((data) => (
        <div>
          <textarea>""</textarea>

          <p>{data.name}</p>
          <p>{data.firstname}</p>
          <p>{data.job}</p>
          <p>{data.email}</p>
          <p>{data.phone}</p>
        </div>
      ))}
    </div>
  );
};

export default Template;
